$("#settings-save-button").click(function(){var b=$("#settingsForm").serializeArray();custombox.confirm("Kaydetmek istedi\u011finize emin misiniz?",function(c){c&&$.post(contextPath+"admin/settings/save",b).fail(function(a){a.state=!1;console.error(a);a.description=lang.get("label.unknown.error");a.redirectUrl=null}).always(function(a){a.state?custombox.alertSuccess(a.description):custombox.alertError(a.description?a.description:lang.get("label.unknown.error"))})})});
